import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom"; // Import React Router components
import Navbar from "./components/Navbar"; // Your Navbar component
//import RecipeList from "./Pages/RecipeList/RecipeList"; // Your Recipe list component
//import RecipeDetail from "./Pages/RecipeDetail/RecipeDetail"; // Detailed recipe page component
//import Login from "./Pages/Login/Login"; // Your Login component
//import Register from './Pages/Register/Register'; // Register component

import "./App.css";  // Uncomment if you want to use CSS

const App = () => {
  return (
    <Router>
      <Navbar /> {/* Navigation bar for routes */}

      <Routes>
        {/* Define the homepage route */}
        <Route path="/" element={<h1>Welcome to Food Recipe Collection</h1>} />

        {/* Define the recipe list route */}
        <Route path="/recipes" element={<RecipeList />} />

        {/* Define the detailed recipe route */}
        <Route path="/recipe/:id" element={<RecipeDetail />} />

        {/* Define the login route */}
        <Route path="/login" element={<Login />} />

        {/* Define the register route */}
        <Route path="/register" element={<Register />} />
      </Routes>
    </Router>
  );
};

export default App;
